import java.util.LinkedHashMap;

public class Main {
    public static void main(String[] args) {
        LinkedHashMap<Integer, Integer> map = new LinkedHashMap<>();
        int[] keys = {5, 10, 15, 20};

        // Fill the map initially with some data
        for (int key : keys) {
            map.put(key, key * 2);
        }

        // Create a non-trivial condition to decide on writing
        int param = (int) (Math.random() * 10);

        if (param < 5) {
            /* write */ map.put(5, 99); // This is the entry affecting the read point
        }

        // Several operations that do not affect the read point
        map.put(10, 40); // Misleading modification
        map.put(30, 60); // Adding new element
        map.remove(15);  // Removing an existing element

        int searchKey = param < 5 ? 5 : 10; // Rectifying misleading condition

        /* read */ int ret = map.get(searchKey); // Retrieval based on previously modified key

        System.out.println("Value retrieved: " + ret);
    }
}
